  [color=purple]All of the marines were wiped out![/color]


  In memoriam of our fallen soldiers:

  Oberon 'Obi' Toski, Ruuk-Xhaz, Paduxi-Utamukeeus, Lilah Jardine.



  Royal Jelly Awards:

  Mature Boiler (IN-927-DY) is awarded the Royal jelly of resilience: 'Stalwart and imposing, you stood behind me in nearly every scream, ready with exactly the type of boil that I wished for. Time after time, when talls would hope to recover the captures I was dragging, or the captures another sister was consuming, you spat them back down to reality with a beautiful boil. For this I can think only to award you with the jelly of resilience.' by Prime Queen (SEA)

  Ancient Boiler (BOI-948) is awarded the Royal jelly of resilience: 'A ruthless warrior, yet always in the backlines. You boiled again and again when you were needed, always exactly doing what I asked to the letter. When talls had a semblance of hope, you were right there to crush them and boil them into nothing. I saw you, along with another boiler, save a disaster and kill over 20 talls. For this I award you with the jelly of resilience.' by Prime Queen (SEA)




